(143, 259, 'Histórico', 'historico', '', '<p style="color: #0059b5; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: normal;" align="center"><span style="color: #0066cc; font-size: x-small;">O Instituto de Pesca, vinculado à Agência Paulista de Tecnologia dos Agronegócios da Secretaria de Agricultura e Abastecimento do Estado de São Paulo, é uma instituição de pesquisa científica e tecnológica que desenvolve projetos nas áreas de pesca e aqüicultura, visando à obtenção e transferência de novos conhecimentos e de tecnologias destinadas à melhoria do agronegócio do pescado e da qualidade ambiental.</span></p>\r\n<p> </p>\r\n<p align="center"> </p>\r\n<p> </p>\r\n<p align="center"><span style="color: #0066cc;"><img src="http://www.pesca.sp.gov.br/img_up/img_1082028494.jpg" border="0" alt="" hspace="0" align="baseline" /></span></p>\r\n<p> </p>\r\n<p align="justify"><span style="color: #0066cc;"> </span></p>\r\n<p> </p>\r\n<p align="right"><strong><span style="color: #0066cc; font-size: small;">(vista frontal, década de 30)</span></strong></p>\r\n<p> </p>\r\n<p align="left"><span style="color: #0066cc; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: xx-small;">Além das instalações destinadas à realização de suas pesquisas, o Instituto conta com espaços privilegiados para o desenvolvimento de atividades educacionais e culturais. Um desses espaços localiza-se no Parque Fernando Costa (conhecido também como "Parque da Água Branca"), uma importante área de lazer da cidade de São Paulo que recebe um grande número de visitantes ao longo do ano: é o "Aquário do Instituto de Pesca", o mais antigo do Estado de São Paulo e o segundo mais antigo do Brasil, construído na década de 30.</span></p>\r\n<p> </p>\r\n<p align="left"><span style="color: #ff0000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: xx-small;">O seu endereço é Avenida Francisco Matarazzo nº 455, metrô Barra Funda. Funciona todos os dias das 9h às 17h, e o valor do ingresso é R$ 2,00, estando isentos crianças até 5 anos, adultos com mais de 65 anos (portando documento) e escolas públicas (agendamento com Ângela, pelo tel: 3865-4130).</span></p>\r\n<p> </p>\r\n<p align="center"> </p>\r\n<p> </p>\r\n<p align="center"><strong><span style="color: #0066cc; font-size: small;"><img src="http://www.pesca.sp.gov.br/img_up/img_1082028627.jpg" border="0" alt="" hspace="0" align="baseline" /></span></strong></p>\r\n<p> </p>\r\n<p align="right"><strong><span style="color: #0066cc; font-size: small;">(o prédio visto por detrás, década de 30)</span></strong></p>\r\n<p> </p>\r\n<p align="center"> </p>\r\n<p> </p>\r\n<p align="center"><strong><span style="color: #0066cc; font-size: small;"><img src="http://www.pesca.sp.gov.br/img_up/img_1082028697.jpg" border="0" alt="" hspace="0" align="baseline" /></span></strong></p>\r\n<p> </p>\r\n<p align="right"><strong><span style="color: #0066cc; font-size: small;">(vista lateral, década de 30)</span></strong></p>\r\n<p> </p>\r\n<p align="justify"><span style="color: #0066cc; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: xx-small;">O Parque está localizado próximo de três dos maiores centros culturais da cidade: o Memorial da América Latina, o Senac e o Sesc-Pompéia.</span></p>\r\n<p> </p>\r\n<p style="color: #0059b5; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: normal;" align="justify"><span style="font-size: xx-small;"><span style="color: #0066cc;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif;">Criado em 1905, numa época de forte desenvolvimento da agropecuária paulista, o Parque destinava-se exclusivamente a abrigar órgãos de pesquisa agropecuária, associações de criadores, leilões e exposições de animais. Hoje tornou-se um grande parque público com características tanto urbanas (abrigando grupos de teatro e dança, de convivência para a terceira idade, etc.) quanto do campo (com diversos animais criados em fazendas, pomar, etc.)</span><span style="font-family: Verdana, Arial, Helvetica, sans-serif;">.</span></span></span></p>\r\n<p> </p>\r\n<p align="justify"><span style="color: #0066cc; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: xx-small;">A importância do interesse do público pelo "Aquário do Instituto de Pesca" pode ser observada pelos números de visitação: 77.199 em 1998, 113.612 em 1999, 112.372 em 2000, 161.475 em 2001 e 168.395 em 2002, números esses registrados apenas em finais de semana e feriados.</span></p>\r\n<p> </p>', '', 1, 0, 0, 87, '2013-04-17 13:36:42', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-04-17 13:36:42', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 2, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
