(144, 260, 'PESCA AMADORA/ESPORTIVA: EXPERIÊNCIAS, DESAFIOS E PERSPECTIVAS PARA O DESENVOLVIMENTO SUSTENTÁVEL DA ATIVIDADE', 'pesca-amadora-esportiva-experiencias-desafios-e-perspectivas-para-o-desenvolvimento-sustentavel-da-atividade', '', '<p>\r\n	Antonio Carlos Sim&otilde;es, Centro de Comunica&ccedil;&atilde;o do Instituto de Pesca, www.pesca.sp.gov.br, abril de 2013&nbsp;<br />\r\n	<br />\r\n	&ldquo;A PESCA AMADORA &eacute; definida como uma atividade de natureza n&atilde;o comercial, caracterizada como &ldquo;hobby ou esporte&rdquo;, cujo praticante n&atilde;o depende dela para sobreviver, sendo praticada como atividade l&uacute;dica ou recreativa. &Eacute; muito popular e crescente no mundo todo, englobando praticantes de diferentes idades e importante para a recrea&ccedil;&atilde;o, a economia e a condi&ccedil;&atilde;o social em v&aacute;rios pa&iacute;ses, gerando emprego e renda nos v&aacute;rios elos da sua cadeia de neg&oacute;cios, e sendo respons&aacute;vel por aproximadamente 12% da produ&ccedil;&atilde;o mundial de pescado&rdquo;, revela Jocemar Tomasino Mendon&ccedil;a, jmendonca@pesca.sp.gov.br, pesquisador cient&iacute;fico do N&uacute;cleo de Pesquisa e Desenvolvimento do Litoral Sul, sediado em Canan&eacute;ia, do Centro do Pescado Marinho de Santos, do Instituto de Pesca (Secretaria de Agricultura e Abastecimento do Estado de S&atilde;o Paulo).&nbsp;<br />\r\n	<br />\r\n	Nos Estados Unidos, por exemplo, os quase 40 milh&otilde;es de pescadores esportivos gastam anualmente cerca de US$ 45 bilh&otilde;es em equipamento, transporte, hospedagem e outras despesas associadas, causando um impacto econ&ocirc;mico de aproximadamente US$ 125 bilh&otilde;es e gerando cerca de um milh&atilde;o de empregos, diz Jocemar.&nbsp;<br />\r\n	<br />\r\n	No Brasil h&aacute; poucas informa&ccedil;&otilde;es dispon&iacute;veis ou nem mesmo existem na maioria das regi&otilde;es. Nas regi&otilde;es Centro-oeste e Norte do pa&iacute;s, a pesca amadora &eacute; um importante componente da economia. No Rio Negro, por exemplo, a atividade atrai anualmente entre 1.400 e 1.800 pescadores esportivos, contribuindo com cerca de US$ 5 milh&otilde;es proveniente de despesas. Tamb&eacute;m h&aacute; estimativas de que anualmente 17.000 pescadores amadores atuem no Mato Grosso do Sul.&nbsp;<br />\r\n	<br />\r\n	Em 2012, atrav&eacute;s de informa&ccedil;&otilde;es do Minist&eacute;rio da Pesca e Aquicultura, o n&uacute;mero de licen&ccedil;as no Estado de S&atilde;o Paulo aproximou-se de 100 mil unidades; houve inclusive aumentos significativos nos &uacute;ltimos anos.&nbsp;<br />\r\n	<br />\r\n	Mas, segundo o pesquisador Jocemar Mendon&ccedil;a, mesmo sendo uma atividade importante e com bem poucos dados, constata-se que a pesca amadora tamb&eacute;m afeta o meio ambiente, gerando impactos que podem comprometer ecossistemas. Jocemar relaciona ent&atilde;o os principais impactos observados:&nbsp;<br />\r\n	<br />\r\n	&bull; Diminui&ccedil;&atilde;o dos estoques de peixes&nbsp;<br />\r\n	&bull; Altera&ccedil;&otilde;es ambientais (aterro, desmatamento e barragem) geradas por obras de infraestrutura tur&iacute;stica&nbsp;<br />\r\n	&bull; Polui&ccedil;&atilde;o de rios por esgotos dom&eacute;sticos e res&iacute;duos de embarca&ccedil;&otilde;es&nbsp;<br />\r\n	&bull; Destrui&ccedil;&atilde;o de &aacute;reas de manguezais e o consequente assoreamento de rios, que p&otilde;e em risco a vida de pescadores etc., causada por abusos da circula&ccedil;&atilde;o de embarca&ccedil;&otilde;es motorizadas em estu&aacute;rios&nbsp;<br />\r\n	&bull; Massifica&ccedil;&atilde;o do turismo de pesca&nbsp;<br />\r\n	&bull; Aumento de pre&ccedil;os no com&eacute;rcio local&nbsp;<br />\r\n	&bull; Conflitos com a pesca tradicional&nbsp;<br />\r\n	<br />\r\n	Em suma, diz o pesquisador do Instituto de Pesca, a pesca amadora no Brasil apresenta grande potencial de desenvolvimento em diversas regi&otilde;es, mas est&aacute; longe de qualquer ordenamento que lhe d&ecirc; sustentabilidade. &ldquo;Um dos principais pontos para racionalizar a atividade &eacute; a obten&ccedil;&atilde;o de informa&ccedil;&otilde;es e seu monitoramento, de forma sistem&aacute;tica e cont&iacute;nua, similar ao que o Instituto de Pesca desenvolve para a pesca marinha no Estado de S&atilde;o Paulo. Este tipo de informa&ccedil;&atilde;o balizaria o fomento e o desenvolvimento sustent&aacute;vel da atividade, diminuindo os impactos existentes e desenvolvendo a atividade de forma racional em todas as regi&otilde;es com potencial&rdquo;, observa Jocemar.&nbsp;<br />\r\n	<br />\r\n	Para discutir a pesca amadora, a mesa-redonda &ldquo;Pesca esportiva: experi&ecirc;ncias, desafios e perspectivas para o desenvolvimento sustent&aacute;vel da atividade&rdquo;, composta pela dra. Solange Aparecida Arrolho da Silva (UNEMAT - Universidade do Estado de Mato Grosso), dr. Alberto Ferreira de Amorim (Instituto de Pesca), engenheiro Jairo Shigueo Naca (Secret&aacute;rio da ANEPE - Associa&ccedil;&atilde;o Nacional de Ecologia e Pesca Esportiva), economista Adalberto Francisco de Oliveira Filho (Federa&ccedil;&atilde;o Paulista de Pesca Esportiva Tur&iacute;stica e Ambiental), MSc. Michel Lopes Machado (do Minist&eacute;rio da Pesca e Aquicultura) e pelo presidente da mesa, dr. Jocemar Tomasino Mendon&ccedil;a, integrou a &ldquo;XI ReCIP (Reuni&atilde;o Cient&iacute;fica do Instituto de Pesca)&rdquo;, realizada de 8 a 10 de abril de 2013.&nbsp;<br />\r\n	<br />\r\n	Na oportunidade, os membros da mesa-redonda apresentaram um panorama da atividade nos aspectos da vis&atilde;o cient&iacute;fica, dos usu&aacute;rios e do &oacute;rg&atilde;o gestor e de licenciamento, o que gerou articula&ccedil;&otilde;es suscept&iacute;veis de novas a&ccedil;&otilde;es para a melhoria da pesca amadora, como o desenvolvimento de projetos destinados a coletar mais informa&ccedil;&otilde;es e a subsidiar o ornamento dessa atividade, principalmente no Estado de S&atilde;o Paulo.&nbsp;<br />\r\n	<br />\r\n	Revis&atilde;o do texto: M&aacute;rcia Navarro Cip&oacute;lli, navarro98@gmail.com&nbsp;</p>\r\n\r\n<p>\r\n	&nbsp;</p>\r\n', '', 1, 0, 0, 87, '2013-04-17 18:09:30', 42, '', '2013-04-18 18:06:18', 42, 0, '0000-00-00 00:00:00', '2013-04-17 18:09:30', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(145, 261, 'SITUAÇÃO DA AQUICULTURA NA REGIÃO NOROESTE DO ESTADO DE SÃO PAULO', 'situacao-da-aquicultura-na-regiao-noroeste-do-estado-de-sao-paulo', '', '<p>\r\n	Antonio Carlos Sim&otilde;es, Centro de Comunica&ccedil;&atilde;o do Instituto de Pesca, www.pesca.sp.gov.br, 9 de abril de 2013&nbsp;</p>\r\n\r\n<p>\r\n	<br />\r\n	NA &Uacute;LTIMA D&Eacute;CADA, a piscicultura vem se desenvolvendo bastante na regi&atilde;o Noroeste Paulista, principalmente com a cria&ccedil;&atilde;o superintensiva e o uso de tanques-rede. Fatores como a temperatura, clima, &aacute;rea alagada dos reservat&oacute;rios e pol&iacute;ticas p&uacute;blicas favoreceram tanto essa regi&atilde;o, que, atualmente, ela se transformou na maior produtora de pescado originado da piscicultura continental do Estado, revela Daniela Castellani, daniela.castellani@apta.sp.gov.br, pesquisadora do Polo Noroeste Paulista, sediado em Votuporanga, da APTA (Ag&ecirc;ncia Paulista de Tecnologia dos Agroneg&oacute;cios) da Secretaria de Agricultura e Abastecimento do Estado de S&atilde;o Paulo. Daniela falou hoje sobre o assunto em sua palestra &ldquo;Situa&ccedil;&atilde;o da aquicultura na regi&atilde;o Noroeste do Estado de S&atilde;o Paulo&rdquo;, durante a XI ReCIP (Reuni&atilde;o Cient&iacute;fica do Instituto de Pesca), realizada de 8 a 10 de abril.&nbsp;</p>\r\n\r\n<p>\r\n	Para a obten&ccedil;&atilde;o e o levantamento dos dados de produ&ccedil;&atilde;o de peixes e seus subprodutos, foram realizadas visitas em fevereiro e mar&ccedil;o de 2013 aos principais estabelecimentos do elo da cadeia dessa atividade, como pisciculturas, frigor&iacute;ficos, f&aacute;bricas de ra&ccedil;&otilde;es e de farinha e &oacute;leo de peixe, bem como entrevistas com t&eacute;cnicos, produtores e gerentes de produ&ccedil;&atilde;o da &aacute;rea, explica Daniela.</p>\r\n\r\n<p>\r\n	A piscicultura na regi&atilde;o Noroeste Paulista caracteriza-se por propriedades administradas por associa&ccedil;&otilde;es e/ou cooperativas de piscicultores, grandes empreendimentos com verticaliza&ccedil;&atilde;o da cadeia e propriedades particulares.&nbsp;</p>\r\n\r\n<p>\r\n	Segundo a pesquisadora, para a cria&ccedil;&atilde;o de til&aacute;pia, o sistema predominante &eacute; o uso de tanques-rede de pequeno volume (6 e 18 m&sup3;), superintensivo, que utiliza densidades 90 a 100 kg de peixes/m&sup3;. Em 2012, algumas pisciculturas j&aacute; introduziram tanques-rede de grande volume (1.600 m&sup3;) a uma densidade de 40 a 50 kg de til&aacute;pia/m&sup3;.&nbsp;</p>\r\n\r\n<p>\r\n	Em tilapicultura, as etapas s&atilde;o: alevinagem, recria (produ&ccedil;&atilde;o de juvenis) e engorda.&nbsp;</p>\r\n\r\n<p>\r\n	A regi&atilde;o possui pelo menos tr&ecirc;s laborat&oacute;rios que produzem em torno de cinco milh&otilde;es de alevinos de til&aacute;pia/m&ecirc;s, adquirindo-se ainda mais alevinos de outro laborat&oacute;rio localizado no Estado do Mato Grosso do Sul.&nbsp;</p>\r\n\r\n<p>\r\n	A produ&ccedil;&atilde;o de juvenis caracteriza-se pela cria&ccedil;&atilde;o em viveiros escavados e bols&otilde;es inseridos dentro dos pr&oacute;prios tanques-rede. Os alevinos (0,5 a 3,0 g) s&atilde;o adquiridos e criados at&eacute; atingirem um tamanho (30 a 40 g), que n&atilde;o permita ultrapassarem a tela do tanque-rede (malha &frac34;&rdquo;).&nbsp;</p>\r\n\r\n<p>\r\n	Geralmente, a engorda &eacute; feita em tanques-rede com classifica&ccedil;&atilde;o (250 a 300 g) ou n&atilde;o at&eacute; o peso de abate (750 a 850 g). S&atilde;o produzidas em torno de 3.500 toneladas/peixe.m&ecirc;s, totalizando 42 mil t/peixe.ano.&nbsp;</p>\r\n\r\n<p>\r\n	A regi&atilde;o conta com tr&ecirc;s frigor&iacute;ficos que processam em torno de 1.400 t/peixe.m&ecirc;s, e duas unidades de produ&ccedil;&atilde;o de &oacute;leo e farinha de peixe, produzindo 75 t/m&ecirc;s e 115 t/m&ecirc;s, respectivamente.&nbsp;</p>\r\n\r\n<p>\r\n	As f&aacute;bricas de ra&ccedil;&atilde;o vendem em torno de 6 mil t/m&ecirc;s. Existem duas f&aacute;bricas de ra&ccedil;&atilde;o na regi&atilde;o, sendo que uma delas domina 70% do mercado.&nbsp;</p>\r\n\r\n<p>\r\n	Outras esp&eacute;cies - como pacu, tambacu, patinga e lambari -, tamb&eacute;m s&atilde;o criadas geralmente em tanques escavados,. A cria&ccedil;&atilde;o de lambari tem crescido bastante, com a finalidade de produ&ccedil;&atilde;o de iscas vivas para a pesca em reservat&oacute;rios, comenta Daniela.&nbsp;</p>\r\n\r\n<p>\r\n	Para a pesquisadora, o maior desafio da atividade &eacute; produzir sem degradar o meio ambiente. &ldquo;Muitas pisciculturas j&aacute; adotaram a pr&aacute;tica do monitoramento da qualidade da &aacute;gua na &aacute;rea de cria&ccedil;&atilde;o e em seu entorno, buscando melhorar a qualidade do produto e preservar o meio ambiente e a vida. Mas podemos enumerar algumas atividades que ainda necessitam de aten&ccedil;&atilde;o, como a pouca conserva&ccedil;&atilde;o do solo e pouca mata ciliar no em torno dos reservat&oacute;rios, a grande mortalidade de peixe com destinos impr&oacute;prios e a necessidade de planos e programas para essas finalidade&nbsp;</p>\r\n\r\n<p>\r\n	Consolidada na regi&atilde;o Noroeste Paulista, a piscicultura deve seu sucesso ao ambiente prop&iacute;cio, a programas de pol&iacute;ticas p&uacute;blicas, &agrave; cria&ccedil;&atilde;o de associa&ccedil;&otilde;es e cooperativa de piscicultores e &agrave; pesquisa e capacita&ccedil;&atilde;o desenvolvidas desde 2005 pela APTA.&nbsp;</p>\r\n\r\n<p>\r\n	<br />\r\n	Revis&atilde;o do texto: M&aacute;rcia Navarro Cip&oacute;lli, navarro98@gmail.com</p>\r\n\r\n<p>\r\n	&nbsp;</p>\r\n', '', 1, 0, 0, 87, '2013-04-17 18:13:11', 42, '', '2013-04-18 17:36:52', 42, 42, '2013-04-18 17:36:52', '2013-04-17 18:13:11', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 0, 0, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
